// src/pages/Admin/AdminSensors.jsx
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Button } from '@/components/ui/button';
import { Input } from '@/components/ui/input';
import { Card, CardContent } from '@/components/ui/card';

const AdminSensors = () => {
    const [sensors, setSensors] = useState([]);
    const [form, setForm] = useState({ type: '', radius: '', status: 'active' });
    const [editingId, setEditingId] = useState(null);

    const fetchSensors = async () => {
        try {
            const res = await axios.get('/api/admin/sensors');
            setSensors(res.data);
        } catch (err) {
            console.error('Failed to fetch sensors:', err);
        }
    };

    useEffect(() => {
        fetchSensors();
    }, []);

    const handleChange = (e) => {
        setForm({ ...form, [e.target.name]: e.target.value });
    };

    const handleSubmit = async () => {
        try {
            if (editingId) {
                await axios.put(`/api/admin/sensors/${editingId}`, form);
            } else {
                await axios.post('/api/admin/sensors', form);
            }
            setForm({ type: '', radius: '', status: 'active' });
            setEditingId(null);
            fetchSensors();
        } catch (err) {
            console.error('Submit error:', err);
        }
    };

    const handleEdit = (sensor) => {
        setForm({
            type: sensor.type,
            radius: sensor.radius,
            status: sensor.status,
        });
        setEditingId(sensor.id);
    };

    const handleDelete = async (id) => {
        try {
            await axios.delete(`/api/admin/sensors/${id}`);
            fetchSensors();
        } catch (err) {
            console.error('Delete error:', err);
        }
    };

    return (
        <div className="p-4 space-y-4">
            <h1 className="text-2xl font-bold">Сенсори</h1>

            <Card>
                <CardContent className="space-y-2 p-4">
                    <Input placeholder="Тип (temperature, soil_moisture, acidity)" name="type" value={form.type} onChange={handleChange} />
                    <Input placeholder="Радіус" name="radius" value={form.radius} onChange={handleChange} />
                    <Input placeholder="Статус (active/inactive)" name="status" value={form.status} onChange={handleChange} />
                    <Button onClick={handleSubmit}>{editingId ? 'Оновити' : 'Додати'} сенсор</Button>
                </CardContent>
            </Card>

            <div className="grid gap-4 grid-cols-1 md:grid-cols-2 lg:grid-cols-3">
                {sensors.map((sensor) => (
                    <Card key={sensor.id}>
                        <CardContent className="p-4 space-y-2">
                            <p><strong>Тип:</strong> {sensor.type}</p>
                            <p><strong>Радіус:</strong> {sensor.radius}</p>
                            <p><strong>Одиниця:</strong> {sensor.unit}</p>
                            <p><strong>Статус:</strong> {sensor.status}</p>
                            <div className="flex gap-2">
                                <Button variant="outline" onClick={() => handleEdit(sensor)}>Редагувати</Button>
                                <Button variant="destructive" onClick={() => handleDelete(sensor.id)}>Видалити</Button>
                            </div>
                        </CardContent>
                    </Card>
                ))}
            </div>
        </div>
    );
};

export default AdminSensors;
